window.bookSummaryJSON = "<p>Winter has come to the world, and still, Erin Solstice has no idea how she came to be an [Innkeeper].</p> <p>Erin is running an inn outside the city of Liscor, but she’s no longer alone. Ryoka Griffin, the City Runner, has business in the south of Izril; she’s out on a dangerous delivery of her own. Yet while both young women have finally found their calling, more and more people are beginning to realize that these visitors from Earth don’t belong here.<br> Erin must find new guests and old for her inn while expanding her tentative business. Staying safe would also be nice. At the same time, some pesky creatures have arrived to herald winter, and they bring mischief and danger unlike anything she’s ever seen. But as more and more children of Earth begin appearing, the cold of winter is the least of Erin’s worries.</p> <p>Download <i>Fae and Fare</i> and get a sneak preview of <i>The Last Tide</i>, a new comic book based on The Wandering Inn series.&nbsp;</p>"; 
